import React from 'react'

const EditApartment = props => {
  return(
    <>
      <h3>Edit your apartment listing.</h3>
      <a href="/">Home</a>
      <a href={`/apartments/${props.apt.id}`}>Back to listing profile</a>
    </>
  )
}

export default EditApartment
